// App.js

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { getTokenFromUrl, setAccessToken, loginUrl } from './spotifyAuth';
import spotifyApi from './spotifyAuth';
import Login from './components/Login';
import RecentlyPlayed from './components/RecentlyPlayed';
import TopArtists from './components/TopArtists';
import TopTracks from './components/TopTracks';
import './App.css';
import spotifyLogo from './Spotify Logo.png';
import CurrentlyPlaying from './components/CurrentlyPlaying';
import FavoriteTracks from './components/FavoriteTracks';
import TopGenresButton from './components/TopGenresButton';
import Search from './components/Search';

function App() {
  const [user, setUser] = useState(null);
  const [favorites, setFavorites] = useState([]);

  useEffect(() => {
    const hash = getTokenFromUrl();
    window.location.hash = '';
    const token = hash.access_token;

    if (token) {
      setAccessToken(token);

      // Fetch user data
      spotifyApi.getMe().then((userData) => {
        setUser(userData);
      });
    }    
  }, []);

  const handleLogout = () => {
    // Implement logout logic
    // For example, you can clear the access token and user data
    setAccessToken(null);
    setUser(null);
  };

  const SpotifyPlayer = () => {
    useEffect(() => {
      const script = document.createElement('script');
      script.src = 'https://sdk.scdn.co/spotify-player.js';
      script.async = true;
      document.body.appendChild(script);

      script.onload = () => {
        window.onSpotifyWebPlaybackSDKReady = () => {
          const token = 'YOUR_ACCESS_TOKEN'; // Replace with the actual access token

          const player = new window.Spotify.Player({
            name: 'Your App Name',
            getOAuthToken: (cb) => {
              cb(token);
            },
          });

          // Error handling
          player.addListener('initialization_error', ({ message }) => {
            console.error(message);
          });
          player.addListener('authentication_error', ({ message }) => {
            console.error(message);
          });
          player.addListener('account_error', ({ message }) => {
            console.error(message);
          });
          player.addListener('playback_error', ({ message }) => {
            console.error(message);
          });

          // Ready
          player.addListener('ready', ({ device_id }) => {
            console.log('Ready with Device ID', device_id);
          });

          // Connect to the player!
          player.connect();
        };
      };

      return () => {
        document.body.removeChild(script);
      };
    }, []);

    return (
      <div>
        <div>
          {/* Your playback controls (play, pause, next, previous) */}
          <button>Play</button>
          <button>Pause</button>
          <button>Next</button>
          <button>Previous</button>
        </div>
        <div>
          {/* Display currently playing track information */}
          <h3>Now Playing:</h3>
          <p>Track Name</p>
          <p>Artist Name</p>
          <p>Album Name</p>
        </div>
        {/* Add more UI elements as needed */}
      </div>
    );
  };

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Link to="/" className="home-link">
            <h1>Spotify Monthly Wrapped</h1>
          </Link>
          <div className="user-greeting">
              {user && <p>Hello {user.display_name || user.id}!</p>}
          </div>
          <a href="https://www.spotify.com/" target="_blank" rel="noopener noreferrer">
            <img src={spotifyLogo} alt="Spotify Logo" className="spotify-logo" />
          </a>
          <nav>
            <ul>
              <li>
                {user ? (
                  <button onClick={handleLogout} className="logout-button">
                    Logout
                  </button>
                ) : (
                  <a href={loginUrl} className="login-button">
                    Login with Spotify
                  </a>
                )}
              </li>
              {user && (
                <li>
                  <Link to="/search" className="nav-link">
                  Search
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/recently-played" className="nav-link">
                    Recently Played Tracks
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/top-tracks" className="nav-link">
                    Top Tracks This Month
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/top-artists" className="nav-link">
                    Top Artists This Month
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/top-genres" className="nav-link">
                    Top Genres This Months
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/currently-playing" className="nav-link">
                    Currently Playing
                  </Link>
                </li>
              )}
              {user && (
                <li>
                  <Link to="/favorites" className="nav-link">
                    Favorites
                  </Link>
                </li>
              )}
              {/* Add more navigation links for other features */}
            </ul>
          </nav>
        </header>

        {/* Include SpotifyPlayer directly */}
        <SpotifyPlayer />

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          {user && <Route path="/search" element={<Search setFavorites={setFavorites}/>} />}
          {user && <Route path="/recently-played" element={<RecentlyPlayed setFavorites={setFavorites} />} />}
          {user && <Route path="/top-artists" element={<TopArtists />} />}
          {user && <Route path="/top-tracks" element={<TopTracks user={user} setFavorites={setFavorites} />} />}
          {user && <Route path="/top-genres" element={<TopGenresButton />} />}
          {user && <Route path="/currently-playing" element={<CurrentlyPlaying setFavorites={setFavorites} />} />}
          {user && <Route path="/favorites" element={<FavoriteTracks setFavorites={setFavorites} />} />}
          {/* Add more routes for other features */}
        </Routes>
      </div>
    </Router>
  );
}

